um #9, a trio recording from Ingebrigt HÃ¥ker Flaten with Mazen Kerbaj and Tony Buck, entitled "MOT." Each week Catalytic will continue to reissue these digital albums, formerly member-exclusive, to help raise donations for non-profit organizations chosen by musicians from the collective.

Proceeds raised from sales of "MOT" will go toward the National Alliance Against Racist & Political Repression, an organization suggested by Ingebrigt (https://naarpr.org). "The National Alliance Against Racist and Political Repression was  founded in 1973 in Chicago, Illinois to mount organized action against unjust treatment of individuals because of race or political beliefs.  From its inception the NAARPR has campaigned against police crimes committed primarily against the poor and people of color.  The Alliance initiated a campaign to Stop Police Crimes. Victims of those crimes and their families are actively involved.  The Alliance is organizing for passage of legislation to establish an elected Civilian Police Accountability Council that holds police officers accountable for crimes such as assault, murder, torture, and racial profiling.  Although the NAARPR has a specific focus on the fight against racist and political repression, we see all of these other struggles as linked to our basic fight.  We defend the human rights of all those who are unjustly oppressed."

This CAA program has currently raised a total of $1030 in donations for One DC (www.onedconline.org), Black Girls Code (www.blackgirlscode.com), BYP100 (https://www.byp100.org/about), Black Lives Matter DC (https://www.blacklivesmatterdmv.org), the Fendika Cultural Center (https://fendika.org), PEN America (https://pen.org), the Jazz Coalition (https://www.jazzcoalition.org), and Bail Project (https://bailproject.org) so far. All our thanks for the continued support and solidarity with organizations like these and the Movement for Black Lives.
